import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import '../StyleSheets/customise.css';

function customise() {
    return (
        <div className="container-customise-dashboard">
            <h1>Customise the DashBoard</h1>

            <div className='content-div'>
                <label className='label-di'>Total Income</label><TextField id="outlined-basic" label="Outlined" variant="outlined" />

            </div>
            
            


        </div>
    );
}

export default customise;
